/**
 * Icon Components
 * 
 * This file contains all icon components.
 * Each icon is defined with its SVG path and metadata.
 */

import React from "react"
import { Icon, IconProps } from "./icon"
import { FigmaIcon } from "./figma-icon"
import { IconData, IconCategory } from "./types"

// Helper to create icon component
function createIcon(
  name: string,
  displayName: string,
  category: IconCategory,
  keywords: string[],
  svgPath: string | React.ReactNode,
  description?: string,
  nodeId?: string
): IconData {
  const IconComponent = React.forwardRef<SVGSVGElement, IconProps>(
    (props, ref) => {
      // If SVG path is a placeholder and we have a nodeId, use FigmaIcon component
      if (typeof svgPath === "string" && svgPath === "PLACEHOLDER_SVG_PATH" && nodeId) {
        return <FigmaIcon ref={ref} nodeId={nodeId} displayName={displayName} {...props} />
      }
      
      // If SVG path is a placeholder but no nodeId, show a visible placeholder
      if (typeof svgPath === "string" && svgPath === "PLACEHOLDER_SVG_PATH") {
        return (
          <Icon ref={ref} {...props}>
            <rect x="2" y="2" width="20" height="20" rx="2" stroke="currentColor" strokeWidth="1.5" fill="none" opacity="0.3"/>
            <text x="12" y="16" textAnchor="middle" fontSize="10" fill="currentColor" opacity="0.5">
              {displayName.charAt(0).toUpperCase()}
            </text>
          </Icon>
        )
      }
      
      return (
        <Icon ref={ref} {...props}>
          {typeof svgPath === "string" ? (
            <path d={svgPath} fill="currentColor" />
          ) : (
            svgPath
          )}
        </Icon>
      )
    }
  )
  IconComponent.displayName = displayName

  // Generate SVG code string
  // Handle placeholder SVG paths for icons that haven't been extracted yet
  const svgCode = typeof svgPath === "string" 
    ? svgPath === "PLACEHOLDER_SVG_PATH"
      ? `<svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
  <!-- SVG path needs to be extracted from Figma -->
  <!-- See ICONS-EXTRACTION-GUIDE.md for instructions -->
  <rect x="2" y="2" width="20" height="20" rx="2" stroke="currentColor" stroke-width="2" fill="none"/>
  <text x="12" y="14" text-anchor="middle" font-size="8" fill="currentColor">?</text>
</svg>`
      : `<svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
  <path d="${svgPath}" fill="currentColor"/>
</svg>`
    : `<svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
  <!-- Complex SVG - see component source -->
</svg>`

  return {
    name,
    displayName,
    category,
    keywords,
    description,
    nodeId,
    component: IconComponent,
    svgCode,
  }
}

